Reports calls to <b>equals()</b> or <b>compareTo()</b> were an object is compared for equality with itself.
This means the argument and the qualifier to the call are identical, and it will always return <b>true</b> for <b>equals()</b>
or always <b>0</b> for <b>compareTo()</b>.
